          '   mov     rdi, 1',
          '   mov     rsi, message',
          '   mov     rdx, 25',
          '   syscall',
          '   mov     eax, 60',
          '   xor     rdi, rdi',
          '   syscall',
          'message:',
          'db      "Hello, Netwide Assembler!", 25'
        ].join('\n')
